int binarySearch(int key, int arr[]) {
    // we know that the size of arr is M, otherwise we'd use sizeof to get the number of elements in arr.
    return bs(key, arr, 0, M);
}

int bs(int k, int arr[], int left, int right) {
    /**
     * Recursive binary search implementation.
     *
     * key: the key we're trying to find in arr
     * arr: a sorted array, A
     * left: the left bound of arr
     * right: the right bound of arr
     */
    // divide-and-conquer algorithm. compare k to A[n/2]

    if(k != arr[left] && (right - left <= 1)) {
        return -1;
    }

    int mid = (right - left) / 2 + left;

//    printf("LR: %d..%d\n", left, right);
//    printf("mid: %d\n", mid);

    if (k == arr[mid]) {
        // since this question specifically counts from 1..
        return mid + 1;
    } else if (k < arr[mid]) {
        return bs(k, arr, left, mid);
    } else {
        return bs(k, arr, mid, right);
    }
}
